  @ffi.Int32()
  external int congestion_control;

  @ffi.Int32()
  external int encoding;

  /// Optional schema for encoding
  external ffi.Pointer<ffi.Char> encoding_schema;

  /// Express mode for low latency
  @ffi.Bool()
  external bool is_express;
}

